    return (
        <div>
            <header className={cx("wrapper")}>
                <h2 className={cx("logo")}>LOGO</h2>
                <ul>
                    <li>
                        <a href="">Trang Chủ</a>{" "}
                    </li>
                    <li>
                        <a href="">Sản Phẩm</a>{" "}
                    </li>
                    <li>
                        <a href="">Liên Hệ</a>
                    </li>
                    <li>
                        <a href="">Giới Thiệu</a>
                    </li>
                </ul>
                <button type="buttton">Login</button>
            </header>
        </div>
    );
}

export default Header;
